__NUXT_JSONP__("/about", (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:[{pageInSitemap:{title:b,name:e,pageID:f,menuText:b,visible:{menu:d,sitemap:d},path:g,redirect:a,isFolder:c},page:{pageID:f,name:e,path:a,title:b,menuText:b,pageType:"static",templateName:"Main Template",redirectUrl:h,securePage:c,excludeFromOutputCache:c,visible:{menu:d,sitemap:d},seo:{metaDescription:"Travel blog featuring travel tips, guides, and photography from around the world. ",metaKeywords:"Travel, Blog, Flights, Vacation, Hotels, Trip, Travel Agency, Airlines, Plane Tickets",metaHTML:h,menuVisible:a,sitemapVisible:a},scripts:{excludedFromGlobal:c,top:a,bottom:a},properties:{state:i,modified:"2021-04-06T09:59:02.813",versionID:173},zones:{MainContentZone:[{module:j,item:{contentID:116,properties:{state:i,modified:"2021-08-06T22:46:36.037",versionID:1101,referenceName:"about_richtextarea52",definitionName:j,itemOrder:0},fields:{textblob:"\u003Ch1\u003EAbout Us\u003C\u002Fh1\u003E\n\u003Cp\u003E\u003Cspan\u003EWe are a blog showcasing all the taco places metro Indy has to offer.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cspan\u003EWe do not rate the taco places, but&nbsp;want to give all the different local taco places a shout so you, the reader, can pick one and give it a try!&nbsp;\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\n\u003Cblockquote\u003E\n\u003Cp\u003E\u003Cspan\u003EJobs fill your pockets, tacos fill your soul.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\n\u003C\u002Fblockquote\u003E\n\u003Ch2\u003EOur Mission\u003C\u002Fh2\u003E\n\u003Cp\u003E\u003Cspan\u003EThrough our blog, we love to give everyone guidance and inspiration to try all the different local taco places in Indianapolis metro area.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\n\u003Ch2\u003E\u003Cspan\u003EPurpose\u003C\u002Fspan\u003E\u003C\u002Fh2\u003E\n\u003Cp\u003E\u003Cspan\u003EI developed this website for two reasons: 1) to utilize my web development skills and 2) to share my love of tacos. Indianapolis is blessed with many excellent taco places so I thought I would combine both the love of tacos and&nbsp;love of technology for everyone!\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cspan\u003EI am running this site on&nbsp;Nuxt and using Agility CMS as the backend. It will be hosted on Netlify. I will provide a breakdown of the process and share the website files in the near future.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E"}}}]}},dynamicPageItem:a,moduleData:{},message:a,statusCode:200}],fetch:{"0":{isOpen:c,contentItem:{logo:{label:k,url:"https:\u002F\u002Fcdn.aglty.io\u002Fjzch5p0g\u002Flogos\u002Findy-tacos-logo-300.png",target:a,filesize:19089,pixelHeight:l,pixelWidth:l,height:m,width:m},siteName:k},links:[{text:"Home",path:"\u002Fhome"},{text:"Blog",path:"\u002Fblog"},{text:b,path:g}]}},mutations:void 0}}(null,"About",false,true,"about",9,"\u002Fabout","",2,"RichTextArea","IndyTacos","300",300)));